// Workout.tsx
import React from 'react';
import { Card, CardContent, CardActions, Button, Typography } from '@mui/material';
import { useNavigate } from 'react-router-dom';

interface WorkoutProps {
  id: number;
  title: string;
  description: string;
  image: string;
}

const Workout: React.FC<WorkoutProps> = ({ id, title, description, image }) => {
  const navigate = useNavigate();

  const handlePlanClick = () => {
    // Navigate to the workout details page
    navigate(`/workout-details/${id}`);
  };

  return (
    <Card style={{ margin: '16px', width: '300px' }}>
      {/* Your card content */}
      <CardContent>
        <Typography variant="h5" color="primary" gutterBottom>
          {title}
        </Typography>
        <Typography variant="body2" color="textSecondary" component="p">
          {description}
        </Typography>
      </CardContent>
      
      <CardActions>
        {/* Plan button */}
        <Button size="small" color="primary" onClick={handlePlanClick}>
          Plan
        </Button>
      </CardActions>
    </Card>
  );
};

export default Workout;
